import React, { useEffect, useState } from "react";
import axios from "axios";
import { Link } from "react-router-dom";
import "./login.css";
import "../pages/style.css";
import AdminNab from "./AdminNab";
import { Row } from "react-bootstrap";

export default function WasherProfile() {
  const [washer, setWasher] = useState([]);

  const fetchAll = () => {
    axios
      .get("http://localhost:8082/washer/allwasher")
      .then((resp) => setWasher(resp.data));
  };
  useEffect(fetchAll, []);

  return (
    <div >
    <div className="row body">
      <AdminNab />
      <div className=" wbg col-md-6">
        {/* <div className="mrginprvmsg " >
         */}
        {/* <a style={{ fontSize: "30px" }} class="previous">
          &laquo;
        </a> */}
        {/* <Link
          to="/admin_home"
          style={{ color: "chocolate", fontSize: "30px" }}
          className="previous round"
        >
          Back
        </Link> */}
      </div>
      {/* <h4
        style={{
          color: "Sky Blue",
          backgroundColor: "DeepSkyBlue",
          fontSize: "30px",
        }}
        className="text-center "
      >
        WASHER LIST

      </h4> */}

      {/* <Link to="/add/message" className="btn btn-primary mb-2">

        Add Message
      </Link> */}
      <div className="col-md-6">
        <h4
          style={{
            color: "Sky Blue",
            backgroundColor: "DeepSkyBlue",
            fontSize: "30px",
          }}
          className="text-center "
        >
          WASHER LIST
        </h4>
        <Row xs={1} md={2} className="g-4 ">
          <table class="table table-bordered ">
            <thead
              class="black white-text"
              style={{ backgroundColor: "HotPink" }}
            >
              <tr>
                <th>Id</th>
                <th>Name</th>
                <th>Location</th>
                {/* <th colSpan={2}>Actions</th> */}
              </tr>
            </thead>

            <tbody>
              {washer.map((w, index) => (
                <tr key={index + 1}>
                  {/* <td>{index+1}</td> */}
                  <td>{w.id}</td>
                  <td>{w.name}</td>
                  <td>{w.location}</td>
                  {/* <td>
                <Link
                  to={`/view/message/${m.messageId}`}
                  className="btn btn-primary mb-2"
                >
                  View
                </Link>
              </td> */}
                  {/* <td>
                <Link
                  to={`/update/message/${m.messageId}`}
                  className="btn btn-primary mb-2"
                >
                  Update
                </Link>
              </td> */}
                  {/* <td>
                <Link
                  to={`/message/delete/${m.messageId}`}
                  className="btn btn-primary mb-2"
                >
                  Delete
                </Link>
              </td> */}
                </tr>
              ))}
            </tbody>
          </table>
        </Row>
      </div>
    </div>
    </div>
  );
}
